import{_ as e}from"./chunks/data-cloud-guest-new-stream-s3.CKCAcPRW.js";import{_ as a,c as o,a1 as s,o as n}from"./chunks/framework.BRP8cXOc.js";const r="/agentforce-workshop/data-cloud-guest-new-stream-csv.CmI577Me.webp",d="/agentforce-workshop/data-cloud-guest-new-stream-details.By4ybViS.webp",i="/agentforce-workshop/data-cloud-guest-mapping-individual.DOjzC_9n.webp",l="/agentforce-workshop/data-cloud-guest-mapping-email.DZvJbLHn.webp",c="/agentforce-workshop/data-cloud-guest-mapping-init.OHpYWokc.webp",p="/agentforce-workshop/data-cloud-guest-mapping-final.t5BQfTgx.webp",w=JSON.parse('{"title":"Exercise 2: Ingest Guests from Amazon S3","description":"","frontmatter":{},"headers":[],"relativePath":"agentforce-workshop/data-cloud/2-ingest-s3-guests.md","filePath":"agentforce-workshop/data-cloud/2-ingest-s3-guests.md"}'),u={name:"agentforce-workshop/data-cloud/2-ingest-s3-guests.md"};function g(h,t,m,b,f,k){return n(),o("div",null,t[0]||(t[0]=[s('<h1 id="exercise-2-ingest-guests-from-amazon-s3" tabindex="-1">Exercise 2: Ingest Guests from Amazon S3 <a class="header-anchor" href="#exercise-2-ingest-guests-from-amazon-s3" aria-label="Permalink to &quot;Exercise 2: Ingest Guests from Amazon S3&quot;">​</a></h1><p>Coral Cloud Resorts stores Guest information in Amazon S3. In this exercise, you will:</p><ol><li><p>Create a data stream that ingests guests into Data Cloud.</p></li><li><p>Map the Guest data lake object to the Individual data model object.</p></li></ol><h2 id="step-1-create-the-guest-data-stream" tabindex="-1">Step 1: Create the Guest data stream <a class="header-anchor" href="#step-1-create-the-guest-data-stream" aria-label="Permalink to &quot;Step 1: Create the Guest data stream&quot;">​</a></h2><p>In this step, you&#39;ll create a data stream that ingests Guests from Amazon S3.</p><ol><li><p>Using the App Launcher, open the <strong>Data Cloud</strong> application.</p></li><li><p>Click the <strong>Data Streams</strong> tab.</p></li><li><p>Click <strong>New</strong>.</p></li><li><p>Under <strong>Other Sources</strong>, click <strong>Amazon S3</strong>, and click <strong>Next</strong>.</p><p><img src="'+e+'" alt="" data-zoomable="true"></p></li><li><p>Configure the data stream with the following values:</p><table tabindex="0"><thead><tr><th><strong>Field</strong></th><th><strong>Value</strong></th></tr></thead><tbody><tr><td>Connection</td><td><code>Coral Cloud Resorts S3 Connection</code></td></tr><tr><td>File Type</td><td><code>CSV</code></td></tr><tr><td>Import from Directory</td><td>Leave blank</td></tr><tr><td>File Name</td><td><code>Coral_Clouds_Guests.csv</code></td></tr><tr><td>Source</td><td>Keep default: <code>AwsS3_Coral_Cloud_Resorts_S3_Connection</code></td></tr></tbody></table><p><img src="'+r+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Next</strong>.</p></li><li><p>Continue configuring the data stream with the following values (keep the default values for all other fields):</p><table tabindex="0"><thead><tr><th><strong>Field</strong></th><th><strong>Value</strong></th></tr></thead><tbody><tr><td>Data Lake Object Label</td><td><code>Guest</code></td></tr><tr><td>Data Lake Object API Name</td><td>Keep default</td></tr><tr><td>Category</td><td><code>Profile</code></td></tr><tr><td>Primary Key</td><td><code>Guest Id</code></td></tr><tr><td>Email Data Type</td><td><code>Email</code></td></tr><tr><td>Phone Number Data Type</td><td><code>Phone</code></td></tr></tbody></table><p>Use the screenshot below to make sure you set all the right values.</p><p><img src="'+d+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Next</strong>.</p></li><li><p>Keep the default values, and click <strong>Deploy</strong>.</p></li><li><p>Click the <strong>Refresh Now</strong> button to populate the Guest data lake object.</p></li><li><p>Keep the default option and click <strong>Refresh Now</strong>.</p></li><li><p>Click the <strong>Data Lake Objects</strong> tab, and notice that a <strong>Guest</strong> data lake object (DLO) has been created.</p></li></ol><h2 id="step-2-map-the-guest-data-lake-object" tabindex="-1">Step 2: Map the Guest data lake object <a class="header-anchor" href="#step-2-map-the-guest-data-lake-object" aria-label="Permalink to &quot;Step 2: Map the Guest data lake object&quot;">​</a></h2><p>In this step, you&#39;ll map the Guest data lake object to the Customer 360 Data Model objects.</p><p>In Data Cloud, you map Data Lake Objects (DLOs) to a standardized data model known as the Customer 360 Data Model. This canonical data model ensures consistent representation of the data, regardless of its origin. Mapping data to a common data model facilitates data unification, and makes it easy to access and act on data from various sources in a consistent way.</p><p>Coral Cloud Resorts stores Contacts in Salesforce and Guest data in Amazon S3. These systems represent individuals in different ways. For example, Guests in Amazon S3 have a field called &quot;Surname&quot; while Contacts in Salesforce have a field called &quot;Last Name&quot;.</p><p>Data Cloud abstracts these differences by mapping data to the Customer 360 Data Model which includes a generic &quot;Individual&quot; object. Both the Guest object from S3 and the Contact object from Salesforce are mapped to the &quot;Individual&quot; object within Data Cloud.</p><ol><li><p>Click the <strong>Data Lake Objects</strong> tab, and click the <strong>Guest</strong> data lake object.</p></li><li><p>Click the <strong>Start</strong> button in the <strong>Data Mapping</strong> panel on the right.</p></li><li><p>In the <strong>Data Model entities</strong> panel on the right, click the <strong>Select Objects</strong> button.</p></li><li><p>In the <strong>Select Objects</strong> panel, search for the <strong>Individual</strong> object and click the <strong>+</strong> button. If the section expands, click the <strong>+</strong> button again. <strong>Make sure that you see the green tick before moving to the next step</strong>.</p><p><img src="'+i+'" alt="" data-zoomable="true"></p></li><li><p>Now search for the <strong>Contact Point Email</strong> object and click the <strong>+</strong> button. If the section expands, click the <strong>+</strong> button again. <strong>Make sure that you see the green tick before moving to the next step</strong>.</p><p><img src="'+l+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Done</strong>.</p></li><li><p>Make sure that you see the two data model objects you selected on the right-hand side: <strong>Contact Point Email</strong> and <strong>Individual</strong>. The <strong>First Name</strong> and <strong>Surname</strong> fields from the Guest DLO have been mapped automatically to the <strong>First Name</strong> and <strong>Last Name</strong> fields of the Individual DMO.</p><p><img src="'+c+'" alt="" data-zoomable="true"></p></li><li><p>Apply the following mappings by first clicking the field that you want to map on the left, and then clicking the field that you want to map it to on the right. Some of the fields you need will be in the <strong>Unmapped</strong> section of each DMO. You can easily find a field by using the Search box to narrow down the list.</p><table tabindex="0"><thead><tr><th><strong>Data Lake Object</strong></th><th><strong>DLO Field</strong></th><th><strong>→</strong></th><th><strong>Data Model Object</strong></th><th><strong>DMO Field</strong></th></tr></thead><tbody><tr><td>Guest</td><td>Guest Id</td><td>→</td><td>Contact Point Email</td><td>Contact Point Email Id</td></tr><tr><td>Guest</td><td>Guest Id</td><td>→</td><td>Contact Point Email</td><td>Party</td></tr><tr><td>Guest</td><td>Email</td><td>→</td><td>Contact Point Email</td><td>Email Address</td></tr><tr><td>Guest</td><td>Guest Id</td><td>→</td><td>Individual</td><td>Individual Id</td></tr><tr><td>Guest</td><td>First Name</td><td>→</td><td>Individual</td><td>First Name (mapped by default)</td></tr><tr><td>Guest</td><td>Surname</td><td>→</td><td>Individual</td><td>Last Name (mapped by default)</td></tr></tbody></table></li><li><p>Make sure that your mappings are correct using the screenshot below as a reference.</p><p><img src="'+p+'" alt="" data-zoomable="true"></p></li><li><p>Click <strong>Save &amp; Close</strong>. You can ignore any warnings about logging.</p></li></ol><h2 id="summary" tabindex="-1">Summary <a class="header-anchor" href="#summary" aria-label="Permalink to &quot;Summary&quot;">​</a></h2><p>In this exercise, you created a data stream to ingest guest data from Amazon S3 into a Guest data lake object (DLO). You then mapped the DLO&#39;s fields to the corresponding fields in the Customer 360 Data Model.</p><p>Salesforce Contacts and S3 Guests are now available from the same data model object: Individual (and its related objects like Contact Point Email and Contact Point Phone). This will make it easy to access and act on guest data in a consistent way.</p>',15)]))}const S=a(u,[["render",g]]);export{w as __pageData,S as default};
